    const [datos, setDatos] = useState([]);

    useEffect(() => {
      getProductos.then(setDatos);
    }, [])


    return(

        <div className='container'>

            <h1 className='display-4'>Bienvenido de nuevo</h1>
            <div className='container'>
            <div className="row">
                <Card title={'Clientes sin pago'} text={'Las clientas "nombre generico1" y "nombre generico2" deben 200mil y 400mil respectivamente'}/>
                <Card title={'Productos con poco Stock'} text={'Los productos Mascarilla de carbon, y Minimizador de Poros tiene 2 y 3 unidades en stock respectivamente.'}/>
                </div>
            </div>
        </div>
    )
}
